import React, { Component } from 'react';

export default class Arrow_Spinner extends Component {
  constructor(props) {
    super(props);
    this.state= {
			didMount: false,
    }
  }

  componentDidMount() {
		setTimeout(() => {
			this.setState({didMount: true})
	}, 0)
	}

	render() {
		return (
			<div className="arrow_spinner">
				{/* 				<div className="arrow_spinner_next"></div> */}
				<button id="progress-1" className="btn-spinner">
          <span className="icon icon-arrow-right"></span>
          <svg viewBox="0 0 100 100">
          <path className="arrow_spinner_stroke" d="M 50,50 m 0,-48 a 48,48 0 1 1 0,96 a 48,48 0 1 1 0,-96" stroke="#fff" stroke-width="4" fill-opacity="0" stroke-dasharray="301.635, 301.635" stroke-dashoffset= {this.props.time}/*  style={{stroke-dasharray: 301.635, 301.635; stroke-dashoffset: 35.9549;}} */></path>
          </svg>
        </button>
			</div>
		);
	}
}
